import React from 'react';
import CodeCard from './CodeCard';
import { codes } from './data';

const CodeList = ({ difficulty }) => {
  const filteredCodes = difficulty === 'all' 
    ? codes 
    : codes.filter(code => code.difficulty === difficulty);

  return (
    <div className="code-list">
      {filteredCodes.map((code) => (
        <CodeCard key={code.id} title={code.title} code={code.code} difficulty={code.difficulty} />
      ))}
    </div>
  );
};

export default CodeList;
